member.example:
This sample shows how to call ListAsync with required parameters and parse the result.

var credential = new DefaultAzureCredential();
var client = new DataStreamFileClient(credential);

await foreach (var data in client.ListAsync("<measurementId>", "<dataStreamId>"))
{
    JsonElement result = JsonDocument.Parse(data.ToStream()).RootElement;
    Console.WriteLine(result.GetProperty("clientFileName").ToString());
    Console.WriteLine(result.GetProperty("fileUri").ToString());
    Console.WriteLine(result.GetProperty("externalTimeStamp").ToString());
    Console.WriteLine(result.GetProperty("size").ToString());
}

member.remarks:
Below is the JSON schema for one item in the pageable response.
Response Body:
Schema for Array: { clientFileName: string, # Required. fileUri: string, # Required. externalTimeStamp: string, # Required. size: number, # Required. }

