member.example:
This sample shows how to call GenerateAsync with required parameters and parse the result.

var credential = new DefaultAzureCredential();
var client = new DataStreamFileClient(credential);

var operation = await client.GenerateAsync(WaitUntil.Completed, "<measurementId>", "<dataStreamId>");

var response = await operation.WaitForCompletionAsync();
await foreach (var data in response.Value)
{
    JsonElement result = JsonDocument.Parse(data.ToStream()).RootElement;
    Console.WriteLine(result.GetProperty("clientFileName").ToString());
    Console.WriteLine(result.GetProperty("fileUri").ToString());
    Console.WriteLine(result.GetProperty("externalTimeStamp").ToString());
    Console.WriteLine(result.GetProperty("size").ToString());
}

This sample shows how to call GenerateAsync with all parameters, and how to parse the result.

var credential = new DefaultAzureCredential();
var client = new DataStreamFileClient(credential);

var operation = await client.GenerateAsync(WaitUntil.Completed, "<measurementId>", "<dataStreamId>", "<operationId>");

var response = await operation.WaitForCompletionAsync();
await foreach (var data in response.Value)
{
    JsonElement result = JsonDocument.Parse(data.ToStream()).RootElement;
    Console.WriteLine(result.GetProperty("clientFileName").ToString());
    Console.WriteLine(result.GetProperty("fileUri").ToString());
    Console.WriteLine(result.GetProperty("externalTimeStamp").ToString());
    Console.WriteLine(result.GetProperty("size").ToString());
}

